  Mapping Essential Fish Habitat in the US Caribbean to Inform MPA Management (EK60)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-22T23:13:20.567231\",\n\t\"name\": \"nf-13-02-usvi-mapping-essential-fish-habitat-in-the-us-caribbean-to-inform-mpa-management\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Scientists will collect high resolution
  multibeam and acoustic fisheries data in mid-water depths approximately 30 to 1000
  meters so as to continue to characterize seafloor habitats within all U.S. States,
  Territories, and Commonwealths. The objective of this project is to collect a multibeam
  bathymetry dataset with 100% seafloor ensonification, along with multibeam backscatter
  suitable for seafloor characterization. Fishery acoustics data will be collected
  to characterize broad-scale fish abundance, biomass, and utilization patterns, as
  well as to locate and document fish spawning aggregations. Multibeam data will be
  collected to conform to IHO Order 1 (<100m) and Order 2 (>100m) accuracy standards.
  The strategies developed for each survey area will take into account the minimum
  depths, general bathymetry, and time allotment. The delineation and identification
  of seafloor habitats will be assisted by the use of a moderate-depth Remotely Operated
  Vehicle (ROV) and drop camera. The vehicle has video and frame camera capability
  to depths of 300 meters and will be used for point sampling within areas mapped
  during this mission.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
